def dices2_sides6_naive(summ):
    counter=0
    for i in range(1,7):
        for j in range(1,7):
            if(i+j)==summ:
                counter+=1
    return counter

def dices2_naive(summ,sides):
    counter=0
    for i in range(1,sides+1):
        for j in range(1,sides+1):
            if(i+j)==summ:
                counter+=1
    return counter




def dices_sum_naive(summ, amount, sides):
    counter = 0

    for i in range(0, sides ** amount):
        number_sum = amount
        number = i
        while number != 0:
            number_sum += number % sides
            number //= sides
        if number_sum == summ:
            counter += 1

    return counter


def dices_sum_recursive(summ, amount, sides):
    if summ == 0 and amount == 0: return 1
    if summ <= 0 or amount <= 0: return 0

    S = 0
    for i in range(1, sides + 1):
        S += dices_sum_recursive(summ - i, amount - 1, sides)
    return S


def dices_sum_dynamic(summ, amount, sides):
    SUMS = [[0 for j in range(summ)] for i in range(amount)]
    SUMS[0][0] = 1

    for i in range(1, len(SUMS)):
        for j in range(1, len(SUMS[0])):
            S = 0
            for k in range(1, sides + 1):
                if j - k >= 0:
                    S += SUMS[i - 1][j - k]
            SUMS[i][j] = S

    S = 0
    for k in range(1, sides + 1):
        if summ - k >= 0:
            S += SUMS[amount - 1][summ - k]
    return S


def polynomial_multiply(a, b):
    c = [0] * (len(a) + len(b) - 1)

    for i in range(len(a)):
        for j in range(len(b)):
            c[i + j] += a[i] * b[j]

    return c


def polynomial_exponentiation(a, n):
    result = [1]
    while n != 0:
        if n % 2 != 0:
            result = polynomial_multiply(result, a)
        a = polynomial_multiply(a, a)
        n //= 2
    return result


def dices_sum_polynomial(summ, amount, sides):
    P = [1] * sides
    P = polynomial_exponentiation(P, amount)
    answer = P[summ - amount]
    return answer


def polynomial_fft_multiply(A, B):
    n = len(A) + len(B) - 1
    F_A = fft(A, n)
    F_B = fft(B, n)
    F_C = [0] * n
    for i in range(n):
        F_C[i] = F_A[i] * F_B[i]
    C = [int(z.real) for z in ifft(F_C)]
    return C


def polynomial_fft_exponentiation(a, n):
    result = [1]
    while n != 0:
        if n % 2 != 0:
            result = polynomial_fft_multiply(result, a)
        a = polynomial_fft_multiply(a, a)
        n //= 2
    return result


def dices_sum_fft_polynomial(summ, amount, sides):
    P = [1] * sides
    P = polynomial_fft_exponentiation(P, amount)
    answer = P[summ - amount]
    return answer


def get_a_proper_prime(n, M):
    k = 1
    while not (Prime.is_prime(k * n + 1) and k * n + 1 >= M):
        k = k + 1
    return k * n + 1

